import React, { useState } from 'react'

function Login() {
  const [data, setData] = useState({
    username: '',
    email: '',
    address: '',
    password: '',
  })

  let onChange = (e) => {
    setData({
      [e.target.name]: e.target.value,
    })
    console.log(data)
  }

  return (
    <div>
      <h1>Login</h1>

      <label>Username</label>
      <input
        type="text"
        name="username"
        value={data.username}
        onChange={onChange}
      />
      <br></br>
      <br></br>

      <label>Email</label>
      <input type="email" name="email" value={data.email} onChange={onChange} />
      <br></br>
      <br></br>

      <label>Address</label>
      <input
        type="text"
        name="address"
        value={data.address}
        onChange={onChange}
      />
      <br></br>
      <br></br>
    </div>
  )
}

export default Login
